import React from "react";
import { Link, Redirect } from "react-router-dom";

const AuthModule = () => {
  var start = window.sessionStorage.getItem("isAuth");

  if (start === "true") {
    var decision = 1;
    console.log("The Decision is : " + decision);
  } else {
    var decision = 0;
    console.log("The Deicions is : " + decision);
  }

  return (
    <div>
      {decision ? (
        <Redirect to={"/user/Michael/Wicks"} />
      ) : (
        <div>
          <Link to="/register">
            <button>Register</button>
          </Link>
          <br />
          <br />
          <Link to="/login">
            <button>Login</button>
          </Link>
        </div>
      )}
    </div>
  );
};

export default AuthModule;
